import React from 'react';
import { SocialData } from '../../Data/social';

function SocialContact() {
    const data = SocialData;
    return (
        <div className = "socialContact">
            {data.map(data.forEach(item => {
                return (
                    <a href = {item.link}>

                    </a>
                )
            })
        )}
        </div>
    )
}

export default SocialContact
